FeedPackage.ReleaseNotes:
Work with plugin and workflow assemblies in more quick and robust way, in good old interface, using all advantages that XrmToolBox offers. 

* Works without need of having early-bound assemblies be resolved; 
* Fixed issue blocking ability to register workflows in isolation mode;
* Null pointer exception during register of workflows was fixed;

Bugfix release:

* Plugin list scrolling issue was fixed;
* Filtered attributes button issue was fixed;

Minor improvements release:

* Null pointer exception during plugin registration process was fixed;
* More explicit error reporting was added;
* Detection of major and minor version changes of assembly was implemented;

